  <React.StrictMode>
    <Card1 />
  </React.StrictMode>,
  document.getElementById('card1')
);
ReactDOM.render(
  <React.StrictMode>
    <Card2 />
  </React.StrictMode>,
  document.getElementById('card2')
);


reportWebVitals();
